(function ($, window, Drupal, drupalSettings) {

        'use strict';

        let urlParams = new URLSearchParams(window.location.search);

        /**
         * @type {Drupal~behavior}
         *
         * @prop {Drupal~behaviorAttach} attach
         * Adds country select behaviour
         */
        Drupal.behaviors.country_select = {
            attach: function (context, settings) {
                // Set browser local storage when user selects a country from country dropdown select.
                $('.country-selector').once('country_select').each(function () {
                    $(this).on('change', function () {
                        let selected_country = $(this).find(':selected').val();
                        urlParams.set('country', selected_country);
                        let now = new Date();
                        let data = {country: selected_country, timestamp: now.getTime()}
                        localStorage.setItem("unicef_locale.selected_country_code", JSON.stringify(data));
                        window.location.search = encodeURI(urlParams.toString());
                    });
                });
            }
        };
    }
)(jQuery, window, Drupal, drupalSettings);

